import React, { Component } from "react";

class SportsList extends Component {
  render() {
    const { subcategory } = this.props;
    return (
      <li className="nrSportsItem">
        <a className="nrSportsLink" href>
          {subcategory.subTitle}
        </a>
      </li>
    );
  }
}

export default SportsList;
